column8:
既存の防水フットウェアとは異なる個性的な仕上がりのモデル。<BR><BR>


Truk StormとKursk Stormは人気のある都市型バイクスニーカーでありながら、<BR>完全防水と優れた透湿性を実現したSTORMテクノロジーが採用されています。<BR><BR>

<BR>もちろん完全防水なので、水をガンガンはねのけながらパドリングが可能！<BR>
<BR>他のペダルシリーズのスニーカーと同様に、キャンバスの25倍の強度を誇る1,000デニールナイロン製アッパーと強化ナイロンを使ったソールを搭載。<BR>
<BR>バルガナイズド製法して製造されています。<BR>

<BR>
