「コンバット」という超定番ブーツをCHROME流の視点でアップデートした新作ブーツ。<BR>アッパーには上質なプルアップレザーを使用。<BR>ソールとの結合面に採用されているステッチアウト製法は、ロガーブーツやマウンテンブーツに使われる製法で、水が浸入しにくく、優れた耐久性を誇ります。<BR>フットベッドにはクッション性に優れたポリウレタン素材を採用し、驚くほど快適な履き心地が続きます。<BR>スピードレースシステムとリフレクティブヒールを搭載。<BR>ストリートにおける機動性と高い視認性を発揮します。<BR>
<BR>
<BR>※プルアップレザー：オイルドレザーの一種。通常のオイルドレザーと比較し、革の繊維内により多くのオイル 分を含ませている。そのため革の裏側から指先で革を押すと、その部分のオイルが繊維内を移動して表面の色が明るく変化するという特質を持つ。ワークブーツなどに採用されることが多い。
